import React from 'react';
import ProductList from '../Products/ProductList';
import Footer from '../Header/Footer';
import { Products } from "../../data";

const Home = () => {
    return (
        <div className="container">
            <ProductList items={Products}/>
            <hr/>
            <Footer/>
        </div>
    )
}

export default Home;
